import React from 'react';
import logo from './logo.svg';
import './App.css';


function App() {
    return (
        <div className="Head">
            <header>
                <img src="https://images5.alphacoders.com/587/thumb-1920-587597.jpg" alt="Kaneki-kun"/></header>
            <div className="sidebar">
                <ul>
                    <li>News</li>
                    <li>About</li>
                    <li>Articles</li>
                    <li>Review</li>
                </ul>
            </div>
            <div className="content">
                <img src="" alt=""/>
            </div>
        </div>

    );
}


export default App;
